description:
Again, under a dock at Pillar Point Harbor.  It matches the description of <i>Myxicola infundibulum</i> in Light's in that it has violet radiolar tips, but I'm not sure you would call a dock a &quot;soft sediment.&quot;

Anyone know it?  I think the whole colony might have been 10-15 cm across.  That's a large mussel in the left of the image, if that helps with scale.

<strong>Update:</strong> Polychaete expert leslieworms from Flickr gave me a really great <a href="http://flickr.com/photos/ken-ichi/3264081853/">description of the taxonomic situation of <i>Myxicola</i> in CA</a>.
